#[cfg(test)]
mod tests {

    use std::io::Read;
    use std::collections::BTreeSet;
    use std::collections::BTreeMap;
    use lz4;
    use super::DATA;
    use binlex::formats::PE;
    use binlex::Architecture;
    use binlex::Config;

    #[test]
    fn test_formats_pe() {
        let config = Config::new();
        let mut decoder = lz4::Decoder::new(DATA).expect("failed to create lz4 decoder");
        let mut data = Vec::new();
        let result = decoder.read_to_end(&mut data);
        assert!(result.is_ok(), "failed to lz4 decompress pe file");
        let pe_result = PE::from_bytes(data, config);
        assert!(pe_result.is_ok(), "failed to parse pe file");
        let pe = pe_result.unwrap();
        assert_eq!(pe.entrypoint(), 0x140001cd0, "incorrect pe entrypoint");
        let mut executable_address_ranges = BTreeMap::<u64, u64>::new();
        executable_address_ranges.insert(0x140001000, 0x140002839);
        assert_eq!(pe.executable_virtual_address_ranges(), executable_address_ranges, "pe execuable address ranges are incorrect");
        assert_eq!(pe.architecture(), Architecture::AMD64, "incorrect pe architecture");
        let sha256_result = pe.sha256();
        assert!(sha256_result.is_some(), "sha256 of pe should not be none");
        assert_eq!(sha256_result.unwrap(), "227f75802f50956a31c7623932fdc640706ae1b9f65b1f628ea3e6d8e759c7ec", "the pe sha256 does not match");
        let tlsh_result = pe.tlsh();
        assert!(tlsh_result.is_some(), "tlsh of pe should not be none");
        assert_eq!(tlsh_result.unwrap(), "T1F682290A774B88E6D226923EC5638F18E272F51257626BCFA362439D0FB13D06D37D45", "the pe tlsh does not match");
        assert_eq!(pe.imagebase(), 0x140000000, "the pe imagebase is incorrect");
        assert_eq!(pe.sizeofheaders(), 1024, "the pe header size is incorrect");
        assert_eq!(pe.size(), 18432, "the size of the pe file in bytes is incorrect");
        let set: BTreeSet<u64> = [
                0x140001180,
                0x1400012a0,
                0x1400013b0,
                0x140001420,
                0x140001450,
                0x140001480,
                0x1400014b0,
                0x140001530,
            ]
            .into_iter()
            .collect();
        assert_eq!(pe.exports(), set, "missing pe exports");

    }
}
